La Protegee De Lola (Marc Dorcel / DvdRip / 1991)

Dans un tourbillon d'effets video venant soutenir des scenes d'accouplements tres excitantes, on ne peut qu'eprouver une sensation de plaisir en regardant cette retrospective sur les comportements sexuels d'une femme splendide au travers d'une periode qui va de l'apres guerre a nos jours.

Tenessy, Sandrine Van Herpe, Alain L'Yle, Shirley, Celine

Feature, Vignettes, Porn Stars

